import React from "react";
import Dreamdogimg from "../Images/Dreamdog.jpg";

function Dreamdog() {
    return (

        <div className="row">

            <div>
                <div style={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    height: "50vh",
                    backgroundImage: `url(${Dreamdogimg})`,
                    backgroundPosition: "center",
                    backgroundSize: "cover",
                    backgroundRepeat: "no-repeat"
                }}>
                    <div style={{ padding: "20px", color: "white" }}>

                        <h1>Centered Child Container with Background Image</h1>
                        <p>This child container is centered within the parent with a background image.</p>

                    </div>
                </div>

            </div>
        </div>
    );
}

export default Dreamdog;
